import React from 'react';
import CustomNavbar from '../components/CustomNavbar';
import Breadcrumb from '../components/Breadcrumb';
import FooterTwo from '../components/Footer/FooterTwo';
import FooterData from '../components/Footer/FooterData';
import Partner from '../components/Partner';


const Ubr = () => {
    return(
        <div className="body_wrapper">
            <CustomNavbar slogo="sticky_logo" mClass="menu_tracking" nClass="w_menu ml-auto mr-auto"/>
            <Breadcrumb breadcrumbClass="breadcrumb_area" imgName="breadcrumb/banner_bg.png" Ptitle="Unidad Básica de Rehabilitación" Pdescription=""/>
            <div class="row mb-3 pl_100 pr_100 mt_100 mb_100">
            <div class="col-lg-6">
            <h3 className='text-center'>Objetivo:</h3>
                <p className='text-justify'>En DIF Jocotepec, a través de su unidad básica de rehabilitación, ponemos a su servicio la atención de pacientes que presente algún tipo de discapacidad física ya sea temporal o permanente; brindada a traves de un conjunto de medios y técnicas especializadas, con la finalidad de ayudar, mejorar o readaptar al individuo discapacitado a la reincorporación de su vida cotidiana y ser un individuo autónomo en su vida personal, familiar y social.</p>
            </div>
            <div class="col-lg-6 text-center">
                <div>
                <h3>Costo de la Valoración Medica:</h3>
                <p>$250.00 pesos Mx</p>
                <h3>Costode la terapia:</h3>
                <p>$150.00 pesos Mx</p>
                <h3>Dirección:</h3>
                <p>Matamoros sur # 330 a espaldas de la cruz verde</p>
                <h3>Horario:</h3>
                <p>Lunes a Viernes de 8:30 a 15:00 horas</p>
                <h3>Teléfono:</h3>
                <a href='tel:877633300'>87 763 33 00</a>
                </div>
            </div>
            </div>
            <div className='row'>
            <div className='container text-center pt_160 sec_pad_b'>
                <h3>Mapa del centro de atención:</h3>
                <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3742.514755943065!2d-103.4293579!3d20.278949700000002!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x842f5c0cbd22f6cb%3A0x1506edb3d59761bb!2sMatamoros%20Sur%20330%2C%20Unidad%20Deportiva%20Sur%2C%2045800%20Jocotepec%2C%20Jal.!5e0!3m2!1ses!2smx!4v1652998508099!5m2!1ses!2smx" width="600" height="450" />
            </div>
            </div>
            <Partner pClass="partner_logo_area_two" pClasst="pt-0 mb-0"/>{/**esta es la parte de los logos de la dependencia */}
            <FooterTwo fClass="pt_150" FooterData={FooterData}/>

        </div>

    );

}

export default Ubr;
